import './index.css';
import bob_esponja from '../../assets/bob_esponja.png'

export default function Home({ history }) {
  return (
    <>
      <h1 className="title">T√çTULO</h1>
      <img src={bob_esponja} className="game-img" alt="Game" />
      <h2 className="subtitle">COMO JOGAR:</h2>
      <p className="game-desc">&emsp;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Praesent convallis volutpat justo quis molestie. Proin gravida, neque a hendrerit consectetur, arcu sem molestie velit, at molestie purus lorem ac nibh.</p>
      <button className="play" onClick={() => history.push('/game01')}>PLAY!</button>
    </>
  );
}
